Servir malgré la volupté,
Au mouvement final;
La tâche à travers les méandres,
La responsabilité avec résignation;
Se parodie véhément,
Dehors la qualité,
Laisse s’échapper tolérante;
Maniérer la porte;
Qu'est-ce que la qualité;
Un principe trouve rage et désarroi.

@Chocomatt12 They didn't hit the heights of Soundgarden or Rage but they were a great band nonetheless.
And Chris Cornell...what a singer.
My favourite singer really, only Mike Parton comes close, and he's completely different
